import React, {useEffect, useState} from "react";

import Fact from "./Fact";

function App() {
  useEffect(() => {
    fetch('https://catfact.ninja/facts')
      .then(resp => resp.json())
      .then(json => {
        console.log(json.data)
        const catFacts = json.data;
        catFacts.map(item => {
          console.log("I am working")
          console.log(item.fact)
          return (
            <Fact someFact={item.fact} />
          )
        })
      })
  })

  return (
    <div>
      <h1>CAT FACTS</h1>
    </div>
  );
}

export default App;
